func compute_PMDocument_total (
    inMNames_count : Int,
    inNames : NSArray) -> Int64 {

//--- START OF USER ZONE 2
  var total : Int64 = 0
  for anyObject in inNames {
    let object = anyObject as NameEntity
    total += object.aValue
  }
  return Int64 (total)
//--- END OF USER ZONE 2

}

